import logo from './logo.svg';
import './Home.css';

function Home() {
  return (
    <div className="App">
      <AppBar position="static" alignitems="center" color="primary">
        <Toolbar>
          <Grid container justify="center" wrap="wrap">
            <Grid item>
              <h1>ipon.app</h1>
            </Grid>
          </Grid>
        </Toolbar>
      </AppBar>
    </div>
  );
}

export default Home;
